export const COLUMNS = [
  {
    Header: "Id",
    Footer: "Id",
    accessor: "_id",
    disableFilters: true,
  },
  {
    Header: "Center",
    Footer: "Center",
    accessor: "center",
    //Cell: (props) => <Link to={`/centers/${center._id}`}>{props.value}</Link>,
  },
];
